Datasource.Parameter:
/* waterway_high */
( SELECT osm_id, way, tunnel, waterway AS type
  FROM planet_osm_line
  WHERE waterway IN ('river', 'canal', 'stream', 'ditch', 'drain')
) AS data

/* roads_high */ ( SELECT way, 0 AS tunnel, 0 AS bridge, 'fill' AS render, CASE WHEN highway = 'motorway' THEN 'motorway' WHEN highway = 'motorway_link' THEN 'motorway_link' WHEN highway = 'trunk' THEN 'trunk' WHEN highway = 'trunk_link' THEN 'trunk_link' WHEN highway = 'primary' THEN 'primary' WHEN highway = 'primary_link' THEN 'primary_link' WHEN highway IN ('secondary', 'tertiary') THEN 'mainroad' WHEN highway IN ('secondary_link', 'tertiary_link') THEN 'mainroad_link' WHEN highway = 'residential' THEN 'residential' WHEN highway = 'living_street' THEN 'living_street' WHEN highway = 'service' AND service = 'parking_aisle' THEN 'parking_aisle' WHEN highway = 'service' AND service = 'driveway' THEN 'driveway' WHEN highway IN ('service', 'unclassified', 'road') THEN 'service'
WHEN highway IN ('footway', 'footpath', 'pedestrian', 'path', 'track') AND bicycle = 'designated' THEN 'cycleway' WHEN highway IN ('footway', 'footpath', 'pedestrian', 'path', 'track') AND cycleway = 'track' THEN 'cycleway' WHEN highway IN ('footway', 'footpath', 'pedestrian', 'path', 'track') AND "mtb:scale" >= '0' THEN 'other' WHEN highway = 'footway' AND bicycle = 'no' THEN 'footway' WHEN highway = 'footway' AND bicycle = 'yes' THEN 'cycleway' WHEN highway = 'footpath' AND bicycle = 'no' THEN 'footway' WHEN highway = 'footpath' AND bicycle = 'yes' THEN 'cycleway' WHEN highway = 'pedestrian' AND bicycle = 'no' THEN 'footway' WHEN highway = 'pedestrian' AND bicycle = 'yes' THEN 'cycleway' WHEN highway = 'path' AND bicycle = 'no' THEN 'footway' WHEN highway = 'cycleway' THEN 'cycleway' WHEN highway IN ('footway', 'footpath', 'pedestrian') THEN 'footway'
WHEN highway = 'path' THEN 'other' WHEN highway = 'track' THEN 'other' WHEN highway = 'steps' THEN 'steps' WHEN railway IN ('light_rail', 'subway', 'narrow_gauge', 'rail', 'tram') THEN 'railway' WHEN railway IN ('abandoned', 'disused') THEN 'rail_abandoned' WHEN railway = 'platform' THEN 'footway' ELSE 'other' END AS type FROM planet_osm_line WHERE (highway IS NOT NULL OR railway IS NOT NULL) AND (tunnel IS NULL OR tunnel = 'no') AND (bridge IS NULL OR bridge = 'no') ORDER BY z_order ) AS data

/* constructs_point */
( SELECT way, aerialway, barrier, power, fixme, noexit
    FROM planet_osm_point
    WHERE (aerialway IS NOT NULL OR barrier IS NOT NULL OR power IS NOT NULL OR fixme IS NOT NULL OR noexit IS NOT NULL)
) AS data

/* motorway_label */
( SELECT way, highway AS type, name, ref, tunnel, oneway, CHAR_LENGTH(ref) AS reflen
    FROM planet_osm_line
    WHERE highway IN ('motorway', 'trunk')
      AND (name IS NOT NULL OR ref IS NOT NULL)
) AS data

/* mainroad_label */
( SELECT way, highway AS type, name, oneway, tunnel
  FROM planet_osm_line
  WHERE (name IS NOT NULL OR oneway IN ('yes', 'true', '1', '-1'))
    AND highway IN ('primary', 'secondary', 'tertiary')
) AS data
